import axios from "axios";
import { IPost } from "../interfaces/Posts.interface";

export async function getPost(userId: number | undefined) {
    try {
      const { data } = await axios.get<IPost[]>(process.env.REACT_APP_API + `/post/?userId=${userId}`);
      return data;
    } catch (error) {
      console.log(error);
    }
}

export async function createPost(post: IPost) {
  try {
    const { data } = await axios.post<IPost>(process.env.REACT_APP_API + `/post`);
    return data;
  } catch (error) {
    console.log(error);
  }
}
